let newArr = [{back:"https://images.unsplash.com/photo-1655413036324-c20022b4f361?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxlZGl0b3JpYWwtZmVlZHwzfHx8ZW58MHx8fHw%3D&auto=format&fit=crop&w=500&q=60",
		  icon1:"https://cdn-icons-png.flaticon.com/512/56/56986.png",
		  icon2:"data:image/png;base64,				",
		  img:"https://images.unsplash.com/profile-1604758536753-68fd6f23aaf7image?dpr=1&auto=format&fit=crop&w=32&h=32&q=60&crop=faces&bg=fff",
		   name:"Rajat",
		   icon3:"https://cdn.icon-icons.com/icons2/1875/PNG/512/download_120262.png",
        }
]
newArr.forEach(function(elem){
    let div1 = document.createElement("div");
    let imgMain = document.createElement("img")
    imgMain.src = elem.back;
    div1.append(imgMain)
    let div2 = document.createElement("div");  
    let ddiv1 = document.createElement("div")   
    let icn1 = document.createElement("img")
    icn1.src = elem.icon1; 
    ddiv1.append(icn1);
    let ddiv2 = document.createElement("div")    
    let icn2 = document.createElement("img")
    icn2.src = elem.icon2; 
    ddiv2.append(icn2)  
    div2.append(ddiv1,ddiv2);
    let div3 = document.createElement("div");
    let img1 = document.createElement("img");
    img1.src = elem.img;
    let text = document.createElement("p");
    text.innerText = elem.name;
    div3.append(img1,text)
    let div4 = document.createElement("div");
    let icn3 = document.createElement("img")
    icn3.src = elem.icon3;
    div4.append(icn3);
    document.querySelector("#container").append(div1,div2,div3,div4);
})